import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchDataAction } from "../../Redux/Actions";

export const TodaysMatchResults = () => {
  const dispatch = useDispatch();
  const result = dispatch(
    fetchDataAction({
      url: "https://api-football-v1.p.rapidapi.com/v2/fixtures/date/2020-02-06",
    })
  );

  const data = useSelector(
    (state) =>
      state.fetchDataReducer[
        "https://api-football-v1.p.rapidapi.com/v2/fixtures/date/2020-02-06"
      ]
  );

  console.log({ data });
  return <div>yoyoyo</div>;
};
